        string GetQuery_C1_PARGEREM()
        {
            var query = @$"SELECT DISTINCT VALUE(B.RAMO_EMISSOR
							, '{APOLICES.DCLAPOLICES.APOLICES_RAMO_EMISSOR}')
							, A.DIA_FATURAMENTO
							, A.COD_CORRETOR
							, A.PCCOMCOR
							, A.COD_MOEDA_FAT
							FROM SEGUROS.PARM_GERAIS_EMPRES A LEFT OUTER
							JOIN SEGUROS.VG_PARAM_RAMO_COMP B ON A.NUM_APOLICE = B.NUM_APOLICE WHERE A.NUM_APOLICE = '{PARGEREM.DCLPARM_GERAIS_EMPRES.PARGEREM_NUM_APOLICE}' AND A.DIA_FATURAMENTO IN (1
							, 2
							, 3)";

            return query;
        }

