                    /*" -11155- DISPLAY 'IND-ERRO = ' W-GE3000B-IND-ERRO-FIN */
                    _.Display($"IND-ERRO = {PMONWK01.W_GE3000B_IND_ERRO_FIN}");

                    /*" -11155- DISPLAY '<' W-GE3000B-MSG-ERRO-FIN '>' */

                    $"<{PMONWK01.W_GE3000B_MSG_ERRO_FIN}>"
                    .Display();

                    /*" -11155- END-IF */
                }


                /*" -11155- END-IF */
            }


            /*" -11155- DISPLAY '%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%' '%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%' */
            _.Display($"%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%");

            /*" -11155- DISPLAY ' ' */
            _.Display($" ");

        }

        [StopWatch]
        /*" PMONITOR-CALL-GE3000B */
        private void PMONITOR_CALL_GE3000B(bool isPerform = false)
        {
            /*" -11155- MOVE 'PMCAL' TO W-GE3000B-PARAGRAFO-ORIG */
            _.Move("PMCAL", PMONWK01.W_GE3000B_PARAGRAFO_ORIG);

            /*" -11155- IF LK-GE3000B-OPERACAO = 'INI' */

            if (PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_OPERACAO == "INI")
            {

                /*" -11155- INITIALIZE LK-GE3000B-SEQ-MONITOR W-GE3000B-MSG-ERRO-INI */
                _.Initialize(
                    PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_SEQ_MONITOR
                    , PMONWK01.W_GE3000B_MSG_ERRO_INI
                );

                /*" -11155- ELSE */
            }
            else
            {


                /*" -11155- INITIALIZE W-GE3000B-MSG-ERRO-FIN */
                _.Initialize(
                    PMONWK01.W_GE3000B_MSG_ERRO_FIN
                );

                /*" -11155- END-IF */
            }


            /*" -11155- INITIALIZE LK-GE3000B-IND-ERRO LK-GE3000B-MSG-RETORNO W-GE3000B-RETURN-CODE W-GE3000B-MSG-ERRO */
            _.Initialize(
                PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_IND_ERRO
                , PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_MSG_RETORNO
                , PMONWK01.W_GE3000B_RETURN_CODE
                , PMONWK01.W_GE3000B_MSG_ERRO
            );

            /*" -11155- MOVE 'GE3000B' TO W-GE3000B-PROG-CALL */
            _.Move("GE3000B", PMONWK01.W_GE3000B_PROG_CALL);

            /*" -11155- CALL W-GE3000B-PROG-CALL USING LK-GE3000B-PARAMETROS */
            _.Call(PMONWK01.W_GE3000B_PROG_CALL, PMONLK01.LK_GE3000B_PARAMETROS);

            /*" -11155- MOVE RETURN-CODE TO W-GE3000B-RETURN-CODE */
            _.Move(RETURN_CODE, PMONWK01.W_GE3000B_RETURN_CODE);

            /*" -11155- IF W-GE3000B-RETURN-CODE NOT = 0 */

            if (PMONWK01.W_GE3000B_RETURN_CODE != 0)
            {

                /*" -11155- DISPLAY W-PROGRAMA '-' W-GE3000B-PARAGRAFO-ORIG */

                $"{W_PROGRAMA}-{PMONWK01.W_GE3000B_PARAGRAFO_ORIG}"
                .Display();

                /*" -11155- DISPLAY '>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>' */
                _.Display($">>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>");

                /*" -11155- DISPLAY LK-GE3000B-COD-PROGRAMA '-RETORNOU DO CALL ' W-GE3000B-PROG-CALL '. RC=' W-GE3000B-RETURN-CODE */

                $"{PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_COD_PROGRAMA}-RETORNOU DO CALL {PMONWK01.W_GE3000B_PROG_CALL}. RC={PMONWK01.W_GE3000B_RETURN_CODE}"
                .Display();

                /*" -11155- DISPLAY 'OPERACAO=' LK-GE3000B-OPERACAO */
                _.Display($"OPERACAO={PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_OPERACAO}");

                /*" -11155- DISPLAY 'COD-USUARIO=' LK-GE3000B-COD-USUARIO */
                _.Display($"COD-USUARIO={PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_COD_USUARIO}");

                /*" -11155- DISPLAY 'COD-PROGRAMA=' LK-GE3000B-COD-PROGRAMA */
                _.Display($"COD-PROGRAMA={PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_COD_PROGRAMA}");

                /*" -11155- DISPLAY 'SEQ-MONITOR=' LK-GE3000B-SEQ-MONITOR */
                _.Display($"SEQ-MONITOR={PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_SEQ_MONITOR}");

                /*" -11155- DISPLAY 'IND-ERRO=' LK-GE3000B-IND-ERRO */
                _.Display($"IND-ERRO={PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_IND_ERRO}");

                /*" -11155- DISPLAY 'MSG-RETORNO=' LK-GE3000B-MSG-RETORNO */
                _.Display($"MSG-RETORNO={PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_MSG_RETORNO}");

                /*" -11155- DISPLAY '<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<' */
                _.Display($"<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<");

                /*" -11155- END-IF */
            }


            /*" -11155- IF W-GE3000B-RETURN-CODE NOT = 0 */

            if (PMONWK01.W_GE3000B_RETURN_CODE != 0)
            {

                /*" -11155- STRING LK-GE3000B-COD-PROGRAMA '-ERRO NO CALL ' W-GE3000B-PROG-CALL '. ' 'RC=' W-GE3000B-RETURN-CODE DELIMITED BY SIZE INTO W-GE3000B-MSG-ERRO */
                #region STRING
                var spl610 = PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_COD_PROGRAMA.GetMoveValues();
                spl610 += "-ERRO NO CALL ";
                var spl611 = PMONWK01.W_GE3000B_PROG_CALL.GetMoveValues();
                spl611 += ". ";
                spl611 += "RC=";
                var spl612 = PMONWK01.W_GE3000B_RETURN_CODE.GetMoveValues();
                var results613 = spl610 + spl611 + spl612;
                _.Move(results613, PMONWK01.W_GE3000B_MSG_ERRO);
                #endregion

                /*" -11155- INITIALIZE LK-GE3000B-IND-ERRO */
                _.Initialize(
                    PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_IND_ERRO
                );

                /*" -11155- END-IF */
            }


            /*" -11155- IF LK-GE3000B-IND-ERRO NOT = 0 */

            if (PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_IND_ERRO != 0)
            {

                /*" -11155- MOVE 1 TO W-GE3000B-COUNT */
                _.Move(1, PMONWK01.W_GE3000B_COUNT);

                /*" -11155- INSPECT FUNCTION REVERSE (LK-GE3000B-MSG-RETORNO) TALLYING W-GE3000B-COUNT FOR LEADING SPACE */
                PMONWK01.W_GE3000B_COUNT.Value = PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_MSG_RETORNO.ToString().Reverse().TakeWhile(x => x == ' ').Count();

                /*" -11155- COMPUTE W-GE3000B-COUNT = FUNCTION LENGTH(LK-GE3000B-MSG-RETORNO) + 1 */
                PMONWK01.W_GE3000B_COUNT.Value = PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_MSG_RETORNO.Value.Length + 1;

                /*" -11155- MOVE LK-GE3000B-IND-ERRO TO W-GE3000B-IND-ERRO-INI */
                _.Move(PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_IND_ERRO, PMONWK01.W_GE3000B_IND_ERRO_INI);

                /*" -11155- STRING W-PROGRAMA '-' W-GE3000B-PARAGRAFO-ORIG '-' LK-GE3000B-MSG-RETORNO(1:W-GE3000B-COUNT) DELIMITED BY SIZE INTO W-GE3000B-MSG-ERRO */
                #region STRING
                var spl613 = W_PROGRAMA.GetMoveValues();
                spl613 += "-";
                var spl614 = PMONWK01.W_GE3000B_PARAGRAFO_ORIG.GetMoveValues();
                spl614 += "-";
                var spl615 = PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_MSG_RETORNO.Substring(1, PMONWK01.W_GE3000B_COUNT).GetMoveValues();
                var results616 = spl613 + spl614 + spl615;
                _.Move(results616, PMONWK01.W_GE3000B_MSG_ERRO);
                #endregion

                /*" -11155- END-IF */
            }


            /*" -11155- EVALUATE LK-GE3000B-OPERACAO */
            switch (PMONLK01.LK_GE3000B_PARAMETROS.LK_GE3000B_OPERACAO.Value.Trim())
            {

                /*" -11155- WHEN 'INI' */
                case "INI":

                    /*" -11155- MOVE W-GE3000B-MSG-ERRO TO W-GE3000B-MSG-ERRO-INI */
                    _.Move(PMONWK01.W_GE3000B_MSG_ERRO, PMONWK01.W_GE3000B_MSG_ERRO_INI);

                    /*" -11155- WHEN 'GRA' */
                    break;
                case "GRA":

                    /*" -11155- MOVE W-GE3000B-MSG-ERRO TO W-GE3000B-MSG-ERRO-GRA */
                    _.Move(PMONWK01.W_GE3000B_MSG_ERRO, PMONWK01.W_GE3000B_MSG_ERRO_GRA);

                    /*" -11155- WHEN 'FIN' */
                    break;
                case "FIN":

                    /*" -11155- MOVE W-GE3000B-MSG-ERRO TO W-GE3000B-MSG-ERRO-FIN */
                    _.Move(PMONWK01.W_GE3000B_MSG_ERRO, PMONWK01.W_GE3000B_MSG_ERRO_FIN);

                    /*" -11155- END-EVALUATE */
                    break;
            }


        }
        /*Método Suprimido por falta de linha ou apenas EXIT nome: PMONITOR_CALL_GE3000B_EXIT*/
    }
